import ExpenseItem from './ExpenseItem'

function Expenses(props) {
    return (
        <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title} expense={expenses[0].amount} date={expenses[0].date}></ExpenseItem>
      <ExpenseItem title={expenses[1].title} expense={expenses[1].amount} date={expenses[1].date}></ExpenseItem>
      <ExpenseItem title={expenses[2].title} expense={expenses[2].amount} date={expenses[2].date}></ExpenseItem>
      <ExpenseItem title={expenses[3].title} expense={expenses[3].amount} date={expenses[3].date}></ExpenseItem>
    </div>
    )
}
export default Expenses;
